script: |
  super -f text -I q13416.spq | sort > q13416.out

inputs:
  - name: q13416.spq
    data: |
      SELECT DISTINCT col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE col1 * - col2 NOT IN ( + 16 + - + col0 + - col1 / col1 );
  - name: tab2

outputs:
  - name: q13416.out
    data: |
      51
      67
      77
